import React, { Component } from 'react';
import Axios from 'axios';

export default class App extends Component {
    constructor(){
        super();
        this.state = {
            indexData: []
        }
    }

    componentDidMount() {
        this.selectDefault().then(
            console.log(this.state.indexData)
        )
    }


    selectDefault = () => {
        try {
            Axios.get('http://localhost:8080/').then(
                res => {
                    this.setState({indexData:res.data});
                }
            ).catch(err => {
                console.log(err);
            });
        } catch (err) {
            console.log(err);
        }
    }
    render() {
        return (
            <div>
                {}
            </div>
        );
    }
}
